BackupFilePathPattern=/home/andrew/Gdrive/Bak/{DB_FILENAME}.old.kdbx
ConfigVersion=2
NumberOfRememberedLastDatabases=6
UpdateCheckMessageShown=true

[Browser]
Browser_AllowLocalhostWithPasskeys=true
CustomProxyLocation=
Enabled=true

[GUI]
ApplicationTheme=dark
ColorPasswords=true
CompactMode=true
MinimizeOnClose=true
MinimizeToTray=true
MonospaceNotes=true
MovableToolbar=true
ShowExpiredEntriesOnDatabaseUnlock=false
ShowExpiredEntriesOnDatabaseUnlockOffsetDays=5
ShowTrayIcon=true
