Own="<?xml version=\"1.0\"?><KeeShare><PrivateKey></PrivateKey><PublicKey><Signer>ADMIN</Signer><Key></Key></PublicKey></KeeShare>\n"
QuietSuccess=true

[PasswordGenerator]
AdditionalChars=
ExcludedChars=
Length=14

[Security]
HidePasswordPreviewPanel=false
HideTotpPreviewPanel=true
IconDownloadFallback=true
LockDatabaseIdle=false
LockDatabaseScreenLock=false
PasswordEmptyPlaceholder=true
PasswordsHidden=false
